import React from "react";
import Link from "react-router-dom"
import "./navbar.css";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">GC.</Link>
        </li>

        <li>
          <Link to="/a-propos">A propos</Link>
        </li>
        <li>
          <Link>Projets</Link>
        </li>
        <li>
          <Link>Contact</Link>
        </li>
      </ul>

    </nav>
  );
};

export default Navbar;
